import React from "react"

function Logo(){
    return(
        <div className="logo-container">
            <h3>Simple, traffic-based pricing</h3>
            Sign-up for our 30-day trial. No credit card required. 
            <img class src="./images/pattern-circles.svg"/>
        </div>
    )
}

export default Logo;
